PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE associations (
	id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	name TEXT NOT NULL,
	"type" TEXT NOT NULL,
	color TEXT NOT NULL,
	"contact.preferred" TEXT NOT NULL,
	"contact.homepage" TEXT,
	"contact.instagram" TEXT,
	"contact.fediverse" TEXT,
	"contact.facebook" TEXT,
	"contact.linktree" TEXT,
	"contact.sandlot" TEXT,
  createdAt DATETIME,
  updatedAt DATETIME
);
CREATE TABLE clubs (
    id TEXT NOT NULL PRIMARY KEY,
    associations TEXT NOT NULL DEFAULT '["myruckclub"]',
    contact TEXT NOT NULL,
    coordinates TEXT NOT NULL,
    country TEXT NOT NULL,
    `default` TEXT,
    hasLogo BOOLEAN NOT NULL DEFAULT 0,
    hide BOOLEAN NOT NULL DEFAULT 0,
    name TEXT NOT NULL,
    socialMediaContent TEXT,
    timezone TEXT,
    createdAt DATETIME,
    updatedAt DATETIME
  );
CREATE TABLE events (
	id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	clubId TEXT NOT NULL,
	coordinates TEXT NOT NULL,
	startsAt DATETIME NOT NULL,
	duration TEXT,
	ics TEXT,
	inSummer BOOLEAN NOT NULL DEFAULT 1,
	location TEXT NOT NULL,
	name TEXT NOT NULL,
	"type" TEXT NOT NULL DEFAULT `default`,
	url TEXT NOT NULL,
  createdAt DATETIME,
  updatedAt DATETIME,
	CONSTRAINT events_clubs_FK FOREIGN KEY (clubId) REFERENCES clubs(id)
);
DELETE FROM sqlite_sequence;
COMMIT;